PU   =  p*0.5*b/V;
QU   =  q*0.5*c/V;
RU   =  r*0.5*b/V;
DLEF =  0; % leading edge deflection (fixed at 0 - do not change)
WLEF =  1 - DLEF/25;

% 1D tables
CXQ   = interp1(Aero_AoA,Aero_D( 1,:),alpha*180/pi,'linear');
CYR   = interp1(Aero_AoA,Aero_D( 2,:),alpha*180/pi,'linear');
CYP   = interp1(Aero_AoA,Aero_D( 3,:),alpha*180/pi,'linear');
CZQ   = interp1(Aero_AoA,Aero_D( 4,:),alpha*180/pi,'linear');
DCLB  = interp1(Aero_AoA,Aero_D( 5,:),alpha*180/pi,'linear');
CLR   = interp1(Aero_AoA,Aero_D( 6,:),alpha*180/pi,'linear');
CLP   = interp1(Aero_AoA,Aero_D( 7,:),alpha*180/pi,'linear');
DCM   = interp1(Aero_AoA,Aero_D( 8,:),alpha*180/pi,'linear');
CMQ   = interp1(Aero_AoA,Aero_D( 9,:),alpha*180/pi,'linear');
DCNB  = interp1(Aero_AoA,Aero_D(10,:),alpha*180/pi,'linear');
DCNDA = interp1(Aero_AoA,Aero_D(11,:),alpha*180/pi,'linear');
CNR   = interp1(Aero_AoA,Aero_D(12,:),alpha*180/pi,'linear');
CNP   = interp1(Aero_AoA,Aero_D(13,:),alpha*180/pi,'linear');

% Cx
CXtot = cat(3, Aero_CXDEM25, Aero_CXDEM10, Aero_CXDE0, Aero_CXDE10, Aero_CXDE25);
[iv1, iv2, iv3] = meshgrid(Aero_Beta,Aero_AoA,Aero_De);
CXBAS = interp3(iv1,iv2,iv3,CXtot,beta*180/pi,alpha*180/pi,de,'linear');
Cx = CXBAS + QU*CXQ;
	
% Cy
dCYBAS = interp2(Aero_Beta,Aero_AoA,Aero_CYBAS,beta*180/pi,alpha*180/pi,'linear');
dvCYDA20 = interp2(Aero_Beta,Aero_AoA,Aero_vCYDA20,beta*180/pi,alpha*180/pi,'linear');
dvCYDR30 = interp2(Aero_Beta,Aero_AoA,Aero_vCYDR30,beta*180/pi,alpha*180/pi,'linear');      
CY_Da = (dvCYDA20-dCYBAS)/20.;
CY_Dr = (dvCYDR30-dCYBAS)/30.;
Cy = (dCYBAS + CY_Da*da)*(1-WLEF) + CY_Dr*dr + RU*CYR + PU*CYP;
                           
% Cz
CZtot = cat(3, Aero_CZDEM25, Aero_CZDEM10, Aero_CZDE0, Aero_CZDE10, Aero_CZDE25);
[iv1, iv2, iv3] = meshgrid(Aero_Beta,Aero_AoA,Aero_De);
CZBAS = interp3(iv1,iv2,iv3,CZtot,beta*180/pi,alpha*180/pi,de,'linear');
Cz = CZBAS + QU*CZQ;

% Cl
dvCLDA20 = interp2(Aero_Beta,Aero_AoA,Aero_vCLDA20,beta*180/pi,alpha*180/pi,'linear');
dvCLDR30 = interp2(Aero_Beta,Aero_AoA,Aero_vCLDR30,beta*180/pi,alpha*180/pi,'linear');
vCLDE0 = interp2(Aero_Beta,Aero_AoA,Aero_CLDE0,beta*180/pi,alpha*180/pi,'linear');
CLtot = cat(3, Aero_CLDEM25, Aero_CLDE0, Aero_CLDE25);
[iv1, iv2, iv3]=meshgrid(Aero_Beta,Aero_AoA,[-25 0 25]);
CLBAS = interp3(iv1,iv2,iv3,CLtot,beta*180/pi,alpha*180/pi,de,'linear');
C_l_Da = (dvCLDA20-vCLDE0)/20.;
C_l_Dr = (dvCLDR30-vCLDE0)/30.;
Cl = CLBAS + DCLB*beta*180/pi + C_l_Da*da + C_l_Dr*dr + RU*CLR + PU*CLP;
                           
% Cm
CMtot = cat(3, Aero_CMDEM25, Aero_CMDEM10, Aero_CMDE0, Aero_CMDE10, Aero_CMDE25);
[iv1, iv2, iv3]=meshgrid(Aero_Beta,Aero_AoA,Aero_De);
CMBAS = interp3(iv1,iv2,iv3,CMtot,beta*180/pi,alpha*180/pi,de,'linear');
Cm = CMBAS + DCM + QU*CMQ + Cz*(0.35-CG/100);

% Cn
dvCNDA20 = interp2(Aero_Beta,Aero_AoA,Aero_vCNDA20,beta*180/pi,alpha*180/pi,'linear');
dvCNDR30 = interp2(Aero_Beta,Aero_AoA,Aero_vCNDR30,beta*180/pi,alpha*180/pi,'linear');
vCNDE0 = interp2(Aero_Beta,Aero_AoA,Aero_CNDE0  ,beta*180/pi,alpha*180/pi,'linear');
CNtot = cat(3, Aero_CNDEM25, Aero_CNDE0, Aero_CNDE25);
[iv1, iv2, iv3]=meshgrid(Aero_Beta,Aero_AoA,[-25 0 25]);
CNBAS = interp3(iv1,iv2,iv3,CNtot,beta*180/pi,alpha*180/pi,de,'linear');
C_n_Da = (dvCNDA20-vCNDE0)/20.;
C_n_Dr = (dvCNDR30-vCNDE0)/30.;
Cn = CNBAS + DCNB*beta + C_n_Da*da+ DCNDA*da + C_n_Dr*dr + RU*CNR + PU*CNP - Cy*(0.35-CG/100)*c/b;

%% Equations of motion (wind axis)
% Transform body-axis forces to wind axes: 
CDrag = -cos(alpha)*cos(beta)*Cx - sin(beta)*Cy - sin(alpha)*cos(beta)*Cz ;
CSide = -cos(alpha)*sin(beta)*Cx + cos(beta)*Cy - sin(alpha)*sin(beta)*Cz ;
CLift =  sin(alpha)*          Cx                - cos(alpha)*          Cz ;

qbar = 0.5*rho*V^2;

Drag = CDrag*qbar*S;
Side = CSide*qbar*S;
Lift = CLift*qbar*S;
L    = Cl   *qbar*S*b;
M    = Cm   *qbar*S*c;
N    = Cn   *qbar*S*b;

alphadot = -  Lift*sec(beta)/m/V ...
           +  q ...
           - (p*cos(alpha) + r*sin(alpha))*tan(beta) ...
           +  g/V*sec(beta)*(cos(phi)*cos(theta)*cos(alpha) + sin(theta)*sin(alpha)) ...
           - (T*sec(beta)/m/V)*sin(alpha);

betadot =   Side/m/V ...
          + p*sin(alpha) ...
          - r*cos(alpha) ... 
          + g/V*cos(theta)*sin(phi)*cos(beta) ...
          + g/V*sin(beta) * (cos(alpha)*sin(theta) - sin(alpha)*cos(phi)*cos(theta) + T*cos(alpha)/m/g);

Vdot = - Drag/m...
       + g*(cos(phi)*cos(theta)*sin(alpha)*cos(beta) + sin(phi)*cos(theta)*sin(beta) - sin(theta)*cos(alpha)*cos(beta)) ...
       + (T/m)*cos(beta)*cos(alpha);
   
pdot = ((Iy - Iz)/Ix)*q*r + L/Ix;
qdot = ((Iz - Ix)/Iy)*p*r + M/Iy;
rdot = ((Ix - Iy)/Iz)*p*q + N/Iz;

phidot   = p + q*tan(theta)*sin(phi) + r*tan(theta)*cos(phi);
thetadot =     q*cos(phi)            - r*sin(phi);

xd = [alphadot; betadot; Vdot; pdot; qdot; rdot; phidot; thetadot];